import React from "react";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faFutbol, faTableTennis, faRunning, faDumbbell, faBowlingBall, faSkating, faVolleyballBall, faSkiing } from '@fortawesome/free-solid-svg-icons'
import { Col, Row, Container } from "react-bootstrap";
import blaster from '../../assets/Images/blaster.png'
import './LabelLayout.css'
import SportLabel from "./SportLabel";

const LabelLayout = () => {
    // LIST OF COLORS
    // "badge yellow"
    // "badge orange"
    // "badge pink"
    // "badge red"
    // "badge purple"
    // "badge teal"
    // "badge blue"
    // "badge blue-dark"
    // "badge green"
    // "badge green-dark"
    // "badge silver"
    // "badge gold"
    // "badge dark"
    // "badge red-dark"
    // "badge purple-dark"
    // "badge pink-dark"




    return(
        
        <Container id="label__layout">
            <Row id="label__row">
                <Col><SportLabel className= "badge purple-dark" symbol={<FontAwesomeIcon icon={faFutbol} style={{ 'marginTop':'7px'}}/>}  skillLevel="Recreational"/></Col>
                <Col><SportLabel className= "badge green" symbol={<img src="https://img.icons8.com/ios-filled/25/000000/tennis.png" alt="tennis" style={{'marginTop':'7px'}}/>} skillLevel="Beginner"/></Col>
                <Col><SportLabel className= "badge green-dark" symbol={<FontAwesomeIcon icon={faRunning} style={{'fontSize': '26px', 'marginTop':'7px'}}/>} skillLevel="Beginner"/></Col>
                <Col><SportLabel className= "badge blue-dark" symbol={<img src="https://img.icons8.com/ios-filled/28/000000/cycling-road--v1.png" alt="cycling" style={{'marginTop':'5px'}}/>} skillLevel="Advanced"/></Col>
                <Col><SportLabel className= "badge pink" symbol={<FontAwesomeIcon icon={faTableTennis} style={{'fontSize': '24px', 'marginTop':'7px'}}/>} skillLevel="Intermediate"/></Col>
            </Row>
            <Row id="label__row">
                <Col><SportLabel className= "badge teal" symbol={<img src="https://img.icons8.com/glyph-neue/28/000000/basketball.png" style={{'marginTop':'5px'}}/>} skillLevel="Beginner"/></Col>
                <Col><SportLabel className= "badge red" symbol={<FontAwesomeIcon icon={faDumbbell} style={{'fontSize': '22px', 'marginTop':'9px'}}/>} skillLevel="Beginner"/></Col>
                <Col><SportLabel className= "badge dark" symbol={<FontAwesomeIcon icon={faBowlingBall} style={{'fontSize': '24px', 'marginTop':'7px'}}/>} skillLevel="Beginner"/></Col>
                <Col><SportLabel className= "badge red-dark" symbol={<FontAwesomeIcon icon={faVolleyballBall} style={{'fontSize': '24px', 'marginTop':'7px'}}/>} skillLevel="Beginner"/></Col>
                <Col><SportLabel className= "badge yellow" symbol={<img src="https://img.icons8.com/ios-filled/29/000000/badminton.png" alt="badminton"  style={{'marginTop':'5px'}}/>} skillLevel="Beginner"/></Col>
            </Row>
            <Row id="label__row">
                <Col><SportLabel className= "badge blue" symbol={<img src="https://img.icons8.com/ios-filled/30/000000/paintball-gun.png" alt="paintball" style={{'marginTop':'5px'}}/>} skillLevel="Beginner"/></Col>
                <Col><SportLabel className= "badge purple" symbol={<img src="https://img.icons8.com/ios-filled/30/000000/sports-gun.png" alt="airsoft" style={{'marginTop':'5px'}}/>} skillLevel="Beginner"/></Col>
                <Col><SportLabel className= "badge orange" symbol={<img src={blaster} alt="lasertag" style={{'marginTop':'5px', 'width':'26px', 'transform':'rotate(-25deg)'}}/>} skillLevel="Beginner"/></Col>
                <Col><SportLabel className= "badge gold" symbol={<FontAwesomeIcon icon={faSkating} style={{'fontSize': '24px', 'marginTop':'7px'}}/>} skillLevel="Beginner"/></Col>
                <Col><SportLabel className= "badge silver" symbol={<FontAwesomeIcon icon={faSkiing} style={{'fontSize': '24px', 'marginTop':'9px'}}/>} skillLevel="Beginner"/></Col>
            </Row>
        </Container>
    )
    
}

export default LabelLayout;
